import React from "react";
import "./ContactSection.css";

function ContactSection() {
  return (
    <>
      <div className="contact-container">
        <div className="contact-content">
            <h1 className="contact-header"></h1>
        </div>
      </div>
    </>
  );
}

export default ContactSection;
